window.addEventListener("load", function() {
    let button = document.getElementById("warpButton")

    /** @type {HTMLCanvasElement} */
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;
    class Particle {
        constructor(effect, x, y, color) {
            this.effect = effect
            this.x = 0;
            this.y = 0;
            this.originX = Math.floor(x);
            this.originY = Math.floor(y);
            this.color = color;
            this.size = this.effect.gap + 1;
            this.vx = 0;
            this.vy = 0;
            this.friction = 0.1;
            this.ease = 0.06;
            this.force=0;
            this.dx = 0;
            this.dy = 0;
            this.distance = 0;
            this.angle = 0;
            this.lastForce=0;
        }
        draw(context) {
            context.fillStyle = this.color
            context.fillRect(this.x, this.y, this.size, this.size);
        }

        update(force) {
            this.force=force
            if (this.force>this.lastForce+1) {
                this.friction = 0.99;
                this.vx       += (Math.random()-0.5)*this.force;
                this.vy       += (Math.random()-0.5)*this.force;

            }
            this.lastForce = this.force;
            this.x += (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
            this.y += (this.vy *= this.friction) + (this.originY - this.y) * this.ease;

        }

        warp() {
            this.x = Math.random() * this.effect.width;
            this.y = Math.random() * this.effect.height;
        }
    }


    class Effect {
        constructor(width, height) {
            this.width = width;
            this.height = height;
            this.particlesArray = [];
            this.image = document.getElementById("image1");
            this.centerX = this.width * 0.5;
            this.centerY = this.height * 0.5;
            this.x = this.centerX - this.image.width * 0.5;
            this.y = this.centerY - this.image.height * 0.5;
            this.gap = 4;
            this.mouse = {
                radius: 3000,
                x: undefined,
                y: undefined
            }
            window.addEventListener("mousemove", event => {
                this.mouse.x = event.x;
                this.mouse.y = event.y;
            })
        }

        init(context) {
            context.drawImage(this.image, this.x, this.y);
            const pixels = context.getImageData(0, 0, this.width, this.height).data
            for (let y = 0; y < this.height; y += this.gap) {
                for (let x = 0; x < this.width; x += this.gap) {
                    const index = (y * this.width + x) * 4;
                    const red = pixels[index];
                    const green = pixels[index + 1];
                    const blue = pixels[index + 2];
                    const alpha = pixels[index + 3];
                    const color = `rgb(${red},${green},${blue})`
                    if (alpha > 0) {
                        this.particlesArray.push(new Particle(this, x, y, color))
                    }
                }
            }
        }

        draw(context) {
            this.particlesArray.forEach(particle => {
                particle.draw(context)
            })

        }

        update(force) {
            this.particlesArray.forEach((particle) =>{
                particle.update(force)
                }
            )
        }

        warp() {
            this.particlesArray.forEach(particle =>
                particle.warp()
            )
        }
    }
    button.onclick = () => {
        if (document.querySelector("body > audio")?.paused==false)
            return
        focus = true
        const audioCtx = new AudioContext();
        var audio = new Audio("data:audio/mpeg;base64,");
        document.body.appendChild(audio)
        audio.play()
        var processor = audioCtx.createScriptProcessor(2048, 1, 1);
        var source;
        audio.addEventListener('canplaythrough', function() {
            source = audioCtx.createMediaElementSource(audio);
            source.connect(processor);
            source.connect(audioCtx.destination);
            processor.connect(audioCtx.destination);
        }, false);
        processor.onaudioprocess = function(evt) {
            var input = evt.inputBuffer.getChannelData(0),
                len = input.length,
                total = i = 0,
                rms;
            while (i < len) total += Math.abs(input[i++]);
            rms = Math.sqrt(total / len);

            ctx.clearRect(0, 0, canvas.width, canvas.height);
            effect.draw(ctx);
            effect.update(Math.floor(rms * 10));
        }
    }
    const effect = new Effect(canvas.width, canvas.height)
    effect.init(ctx)
})